static void BuildTrigTables()
{
//	s_SinCosTable = (float*)GlobalAlloc(GMEM_FIXED, sizeof(float)*TRIG_TABLE_SIZE);
//	s_TangentTable = (float*)GlobalAlloc(GMEM_FIXED, sizeof(float)*TRIG_TABLE_SIZE);

	float Angle = 0;
	for (int i=0;i<TRIG_TABLE_SIZE;i++)
	{
		s_SinCosTable[i]=Sine(Angle);
		s_TangentTable[i]=Tangent(Angle);

		Angle+=TRIG_TABLE_FACTOR;

	}

	// print out the tables
	debug_print("*** SINCOS TABLE ***\n");
	int x = 0;
	for (i=0;i<TRIG_TABLE_SIZE>>4;i++)
	{
		debug_print("\t%.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff,\n", 
					s_SinCosTable[x], s_SinCosTable[x+1], s_SinCosTable[x+2], s_SinCosTable[x+3], s_SinCosTable[x+4], s_SinCosTable[x+5], s_SinCosTable[x+6], s_SinCosTable[x+7],
					s_SinCosTable[x+8], s_SinCosTable[x+9], s_SinCosTable[x+10], s_SinCosTable[x+11], s_SinCosTable[x+12], s_SinCosTable[x+13], s_SinCosTable[x+14], s_SinCosTable[x+15]);
		x+=16;
	}
	debug_print("*** TAN TABLE ***\n");
	x = 0;
	for (i=0;i<TRIG_TABLE_SIZE>>4;i++)
	{
		debug_print("\t%.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff, %.08ff,\n", 
					s_TangentTable[x], s_TangentTable[x+1], s_TangentTable[x+2], s_TangentTable[x+3], s_TangentTable[x+4], s_TangentTable[x+5], s_TangentTable[x+6], s_TangentTable[x+7],
					s_TangentTable[x+8], s_TangentTable[x+9], s_TangentTable[x+10], s_TangentTable[x+11], s_TangentTable[x+12], s_TangentTable[x+13], s_TangentTable[x+14], s_TangentTable[x+15]);
		x+=16;
	}
	debug_print("*** END TABLES ***\n");
}

static void BuildSquareRootTable()
{
#ifdef PLATFORM_IEEE_FLOAT
  uint32 i;
  FastSqrtUnion s;

//  fast_sqrt_table = (uint32*)GlobalAlloc(GMEM_FIXED, sizeof(uint32)*0x10000);

  for (i = 0; i <= 0x7FFF; i++)
  {
    // Build a float with the bit pattern i as mantissa
    // and an exponent of 0, stored as 127
    s.i = (i << 8) | (0x7F << 23);
    s.d = (float)sqrt(s.d);

    // Take the square root then strip the first 7 bits of
    // the mantissa into the table
    fast_sqrt_table[i + 0x8000] = (s.i & 0x7FFFFF);

    // Repeat the process, this time with an exponent of 1, 
    // stored as 128
    s.i = (i << 8) | (0x80 << 23);
    s.d = (float)sqrt(s.d);

	fast_sqrt_table[i] = (s.i & 0x7FFFFF);
  }

	DebugPrint("*** fast_sqrt_table TABLE ***\n");
	for (i=0;i<0x10000>>7;i++)
	{
		DebugPrint("\t");
		for (int j=0;j<128;j++)
		{
			DebugPrint("%i, ", fast_sqrt_table[(i<<7)+j]);
		}
		DebugPrint("\n");
	}
	DebugPrint("*** end fast_sqrt_table TABLE ***\n");

#endif
}


bool gaia::InitFastMathTables()
{
	BuildTrigTables();
	BuildSquareRootTable();

	return(true);
}

